import { GridExtension } from "./GridExtension.js";
export class GridExtensionProvider {
  shouldExtend(extensionManager, designerView, designItem) {
    if (getComputedStyle(designItem.element).display == 'grid') return true;
    return false;
  }

  getExtension(extensionManager, designerView, designItem) {
    return new GridExtension(extensionManager, designerView, designItem);
  }

}